// 기존 라우팅 관련 코드는 주석 처리
import React from 'react';
import './App.css';
import DogProfileCard from './DogProfileCard';

function App() {
  const dog = {
    name: '뽀삐',
    age: 3,
    breed: '푸들',
    gender: '남아',
    bio: '산책하는 걸 좋아해요!',
    imageUrl: 'https://images.unsplash.com/photo-1543466835-00a7907e9de1?q=80&w=1000&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxleHBsb3JlLWZlZWR8Mnx8fGVufDB8fHx8fA%3D%3D'
  };

  return (
    <div className="App">
      <DogProfileCard dog={dog} />
    </div>
  );
}

export default App;
